              const rows = candidates.length < 5 ? 1 : Math.ceil(candidates.length / columns)

              let index = 0
              const table = []
              for (let i = 0; i < rows; i++) {
                const row = []
                for (let j = 0; j < columns; j++) {
                  row.push(h('td', `${candidates[index]}  `))
                  index++
                }

                table.push(h('tr', [row]))
              }

              return h('table', {style: {width: '100%'}}, [table])
            }
